def is_match(wild: str, pattern: str) -> bool:
    m = len(pattern)
    n = len(wild)
    dp = [[False] * (n + 1) for _ in range(m + 1)]
    dp[0][0] = False
    for j in range(1, n + 1):
        if wild[j - 1] == '*':
            dp[0][j] = dp[0][j - 1]
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if pattern[i - 1] == wild[j - 1] or wild[j - 1] == '?':
                dp[i][j] = dp[i - 1][j - 1]
            elif wild[j - 1] == '*':
                dp[i][j] = dp[i][j - 1] or dp[i - 1][j]
    return dp[m][n]

